div.script:
         jQuery(function($) {
	    $(".cos-listView>li>div").hide();
        $(".cos-listView>li:first-child div").show();
        $(".cos-listView>li:first-child>a>span.cos-arrow").addClass('aa');
		$(".cosTab").click(function() {
			$(".cosTab").each(function() {
				$(this).parent().find("div.aq").slideUp();
				$(".cos-listView a span").removeClass("aa")
			});
			if ($(this).parent().find("div.aq").css("display") == "block") {
				return false;
			}
			else {
				$(this).parent().find("div.aq").slideDown();
				$(this).find("span").addClass("aa")
			}
			console.log($(this).parent().find("div.aq").css("display"));
		});


	});
